from base64 import b64decode

binstr = ""

decoded = ""
for i in range(0, len(binstr), 8):
    block = binstr[i : i + 8]
    decoded += chr(int(block, 2))

decoded = decoded.split()

decoded_2 = ""
for i in decoded:
    decoded_2 += chr(int(i))

decoded_2 = decoded_2.split()
flag = ""
for i in decoded_2:
    flag += chr(int(i, 16))

print(b64decode(flag).decode())
